textOriginal:
O motivo é simples;
O ser humano quando tem Deus como seu guia, não é manipulado facilmente.
Então, é melhor acabar com a dissimulação de Deus, assim o homem fica como uma galinha, que apesar de arrancar todas as suas penas mesmo assim, corre atrás para comer as migalhas.

A Igreja Católica é a Instituição que mais caridade fez e faz no mundo. A Igreja mantém na *>>Ásia:<<<*
1.076 hospitais;
3.400 dispensários;
330 leprosários;
1.685 asilos;
3.900 orfanatos;
2.960 jardins de infância.

*>>>Na África:<<<<*
