No campo da instrução e da educação, a Igreja administra no mundo 68.119 escolas maternais, frequentadas por 6.522.320 alunos; 92.971 escolas primárias onde estudam 30.973.114 alunos; 42.495 escolas superiores médias com 17.114,731 alunos. Além disso, acompanha 2.288.258 jovens de escolas superiores e 3.275.440 estudantes universitários.
25% das obras que cuidam de aidéticos em todo o mundo são mantidas pela Igreja Católica. 1 DE CADA 5 pessoas nos USA e’ atendida em hospitais católicos!!!

1 João 3
17 *>>>>>><Quem, pois, tiver bens do mundo e, vendo o seu irmão necessitado, lhe cerrar o seu coração, como estará nele o amor de Deus? 18 Meus filhinhos, não amemos de palavra, nem de língua, mas por obra e em VERDADE. 19 E nisto conhecemos que SOMOS DA VERDADE e diante dele asseguraremos nosso coração <<<<*
